layers.vertexShader:
#version 300 es
precision mediump float;
in vec2 aPos;
uniform float uTime;
uniform float uPeriod;
in vec3 aColor;
out vec3 vColor;

void main(){
    vec2 pos = aPos;

    // Move across twice per period
    float progress = mod(uTime / uPeriod * 2.0, 1.0);  // 0.0 to 1.0 every uTime period
    float xOffset = mix(0.0, 4.0, progress);  
    if (xOffset > 2.0) {
        xOffset = -2.0 + xOffset - 2.0;
    } // -2.0 to +2.0

    pos.x += xOffset;

    // Deform vertices in a wave pattern
    pos.y += sin(pos.x * 1.0 + uTime) * 0.04;
    pos.x += cos(pos.y * 1.0 + uTime) * 0.04;

    gl_Position = vec4(pos, 0.0, 1.0);
    vColor = aColor;
}

layers.fragmentShader:
#version 300 es
precision mediump float;
uniform vec4 uColor;
out vec4 outColor;
in vec3 vColor;

void main(){
    // Wave pattern
    float wave = sin(gl_FragCoord.x * 0.05) * 0.8 + 0.2;
    float brightness = mix(0.3, 0.7, wave);
    outColor = vec4(mix(uColor.rgb * brightness, vColor, 0.5), uColor.a);
}

